import React from 'react'
import './whatsapp.css'

const image = [
   { images : 'images/bg.jpg'
}
]
    

const Whatsapp = () => {
    return (
        <>
        <div class="main-body border"> <div className="top-left border"></div>
        <div className="top-right border"></div>
        <div className="bottom-left border"></div>
        <div className="bottom-right border"></div></div>
       
            
        </>
    )
}

export default Whatsapp
